        <div
            key={item.id}
            style={{ backgroundColor: item.on ? "green" : "red" }}
            onClick={() => props.vajuta(item.id)}
        >
            box.{item.id}
        </div>
    ));

    // Return the array of JSX elements
    return (
        <div>
            {boxElements}
        </div>
    );
}

